import React, { Component } from "react";
import axios from "axios";
const stackexURl = "https://api.stackexchange.com/questions?site=stackoverflow";
class Stackex extends Component {
  constructor() {
    super();
    this.state = {
      data: []
    };
  }
  componentDidMount() {
    axios
      .get(`${stackexURl}`)
      //   .then(res => this.setState({ data: res.data.items.tags }));
      .then(res =>
        console.log(res.data.items.map(a => this.setState({ data: a.tags })))
      );
  }
  render() {
    console.log(this.state.data);
    return <div>{this.state.data}</div>;
  }
}

export default Stackex;
